import React from "react"

const CreateAnecdote = (props) =>{
  return(
    <div>
      <h2>create new</h2>
      <form onSubmit={handleCreateAnecdote}>
        <div><input name="anecdote"/></div>
        <button type={"submit"}>create</button>
      </form>
    </div>
  )
};

export default CreateAnecdote
